// Import images
import water from './water.jpg';
import fanta from './fanta.jpg';
import coke from './coke.jpg';
import sprite from './sprite.jpg';
import sting from './sting.jpg';
import dew from './dew.jpg';
import oreoShake from './oreo shake.jpg';
import lemonade from './lemonade.jpg';
import lassi from './lassi.jpg';
import lotusShake from './lotus shake.jpg';
import mangoShake from './mango shake.jpg';
import strawberryShake from './strawberry shake.jpg';

// Define the drinks and beverages array
const drinksAndBeverages = [
    { id: 1, name: "Water", picture: water },
    { id: 2, name: "Fanta", picture: fanta },
    { id: 3, name: "Coke", picture: coke },
    { id: 4, name: "Sprite", picture: sprite },
    { id: 5, name: "Sting", picture: sting },
    { id: 6, name: "Dew", picture: dew },
    { id: 7, name: "Oreo Shake", picture: oreoShake },
    { id: 8, name: "Lemonade", picture: lemonade },
    { id: 9, name: "Lassi", picture: lassi },
    { id: 10, name: "Lotus Shake", picture: lotusShake },
    { id: 11, name: "Mango Shake", picture: mangoShake },
    { id: 12, name: "Strawberry Shake", picture: strawberryShake }
];

// Export the drinks and beverages array
export default drinksAndBeverages;
